import { actionType } from "../constants/actionTypes";

initialState={
    products:[
        {
        id:1,
        title:'Hello',
        desc :'This is for'
    }
],
};
export const productReducer = (state=initialState,{type,payload})=>{
    switch(type){
      case actionType.SET_PRODUCTS:
          return state;
      default :
          return state;
    }

}
